    return (
        <section>
            <div> 
                <img src={logo} alt="" style={{width: '60px', height: ''}}/>
            </div>
            <div className="container-fluid row">
                <div className="col-md-5">
                    <Sidebar></Sidebar>
                </div>
                <div className="col-md-7">
                   <h3>hello</h3>
                </div>
            </div>
        </section>
    );
};

export default Dashboard;
